import {StyleSheet} from "react-native"

const css = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#FFF',
      alignItems: 'center',
      justifyContent: 'center',
    },
    container2: {
      flex: 1,
      flexDirection:'row',
      backgroundColor: '#FFF',
      alignItems: 'center',
      justifyContent: 'center',
    },
    button:{
      width:150,
      height:160
    },
    button__home:{
      marginRight: 20
    },
   darkbg:{
     backgroundColor:"#333"
   },
   login__msg:(text='none')=> ({
     fontWeight:"bold",
     fontSize: 22,
     color:"red",
     marginTop: 10,
     marginBottom: 15,
     display: text
   }),
   login__form:{
     width: "80%"

   },
   login__input:{
     backgroundColor:"#FFF",
     fontSize: 19,
     padding: 7,
     marginBottom: 15
   },
   login__button:{
     padding: 12,
     backgroundColor:"#5768D4",
    alignSelf:"center",
    borderRadius: 5
    },
    login_buttonText:{
      fontWeight:"bold",
      fontSize: 22,
      color: "#333"

    }
  });
  export {css}
